import React from "react";
import TaskList from "./TaskList.js";
import NewTask from "./NewTask.js";
//That is the first component called main component
function App() {
  const tasks = [
    { id: 0, description: "Do this", done: false },
    { id: 1, description: "Do this", done: false },
  ];
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <div className="jumbotron">
            <h1 className="display-4">To Don't List</h1>
          </div>
          <br />
          <NewTask />
          <br />
          <TaskList tasks={tasks} />
        </div>
      </div>
    </div>
  );
}

export default App;
